import React, {
  useState,
  useMemo,
  useRef,
  useEffect,
  useLayoutEffect,
} from "react";
import { useTable, useRowSelect } from "react-table";

const LatLongTable = () => {
  // ------------------------------Define the structure of your table----------------------------------- //

  const columns = useMemo(
    () => [
      {
        Header: () => <div style={{ width: "100%" }}></div>,
        accessor: "id",
      },

      {
        Header: "Command",
        accessor: "command",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "200px" }}>
            <select
              id={`row-${row.values.id}`}
              ref={rowRefs[row.index]}
              value={row.values.command}
              onChange={(e) =>
                updateMyData(row.index, "command", e.target.value)
              }
              style={{ width: "100%" }}
            >
              <option>WAYPOINT</option>
              <option>No</option>
              <option>Maybe</option>
              <option>So</option>
            </select>
          </div>
        ),
      },

      {
        Header: "P1",
        accessor: "P1",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.P1}
              onChange={(e) => updateMyData(row.index, "P1", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "P2",
        accessor: "P2",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.P2}
              onChange={(e) => updateMyData(row.index, "P2", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "P3",
        accessor: "P3",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.P3}
              onChange={(e) => updateMyData(row.index, "P3", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "P4",
        accessor: "P4",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.P4}
              onChange={(e) => updateMyData(row.index, "P4", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Latitude",
        accessor: "Latitude",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Latitude}
              onChange={(e) =>
                updateMyData(row.index, "Latitude", e.target.value)
              }
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Longitude",
        accessor: "Longitude",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Longitude}
              onChange={(e) =>
                updateMyData(row.index, "Longitude", e.target.value)
              }
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Alt",
        accessor: "Alt",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Alt}
              onChange={(e) => updateMyData(row.index, "Alt", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Frame",
        accessor: "Frame",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Frame}
              onChange={(e) => updateMyData(row.index, "Frame", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Grad",
        accessor: "Grad",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Grad}
              onChange={(e) => updateMyData(row.index, "Grad", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Angle",
        accessor: "Angle",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Angle}
              onChange={(e) => updateMyData(row.index, "Angle", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      {
        Header: "Dist",
        accessor: "Dist",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%%" }}>
            <input
              value={row.values.Dist}
              onChange={(e) => updateMyData(row.index, "Dist", e.target.value)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
      // ...
      // ...
      // ...
      {
        Header: "AZ",
        accessor: "AZ",
        Cell: ({ row, updateMyData }) => (
          <div style={{ width: "100%" }}>
            <input
              value={row.values.AZ}
              onChange={(e) => updateMyData(row.index, "AZ", e.target.value)}
              onKeyDown={(e) => keyDownHandler(e, row)}
              style={{ width: "100%" }}
            />
          </div>
        ),
      },
    ],
    []
  );

  const [data, setData] = useState([
    // ...
  ]);

  const [rowRefs, setRowRefs] = useState([]);

  useEffect(() => {
    setRowRefs((oldRefs) =>
      Array(data.length)
        .fill()
        .map((_, i) => oldRefs[i] || createRef())
    );
  }, [data]);

  const updateMyData = (rowIndex, columnId, value) => {
    setData((old) =>
      old.map((row, index) => {
        if (index === rowIndex) {
          return {
            ...old[rowIndex],
            [columnId]: value,
          };
        }
        return row;
      })
    );
  };

  const keyDownHandler = (e, row) => {
    if (e.key === "Tab" && row.index === data.length - 1) {
      e.preventDefault();
      setData((oldData) => [
        ...oldData,
        {
          id: oldData.length + 1,
          command: "",
          p1: "",
          p2: "",
          p3: "",
          p4: "",
          latitude: "",
          longitude: "",
          alt: "",
          frame: "",
          grad: "",
          angle: "",
          dist: "",
          az: "",
        },
      ]);
      setTimeout(() => rowRefs[data.length]?.current?.focus(), 0);
    }
  };

  // ------------------------------Define the structure of your table----------------------------------- //
  //
  //
  //
  //
  // ------------------------------Create a state for your table data----------------------------------- //
  //
